import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import PublicMapView from "./PublicMapView";
import OfficeDashboard from "./OfficeDashboard";
import Login from "./Login";

const App = () => {
  const [loggedInOffice, setLoggedInOffice] = useState(null);

  const handleLogin = (officeData) => {
    setLoggedInOffice(officeData);
  };

  const handleLogout = () => {
    setLoggedInOffice(null);
  };

  return (
    <Router>
      <Routes>
        <Route path="/" element={<PublicMapView loggedInOffice={loggedInOffice} />} />
        <Route path="/login" element={<Login onLogin={handleLogin} />} />
        <Route path="/dashboard" element={loggedInOffice ? <OfficeDashboard officeData={loggedInOffice} onLogout={handleLogout} /> : <Navigate to="/login" />} />
      </Routes>
    </Router>
  );
};

export default App;
